var runCodeFromRemote = function(codeFlag, url, cb) {
    var xhr = new XMLHttpRequest();
    xhr.open('GET', url);
    xhr.onreadystatechange = function () {
        if (xhr.readyState == 4 && (xhr.status >= 200 && xhr.status < 400)) {
            var result = xhr.responseText;
            // decryptCode = xxtea.xxteaDecrypt(result);
            if (codeFlag) {
                new Canjs(result).run();
            }
            if (cb) cb(result);
        }             
     }.bind(this);
    xhr.send(); 
}

var runCodeFromLocal = function(codeFlag, url, cb) {
    var fsm = wx.getFileSystemManager();
    var result = fsm.readFileSync(url, 'utf-8')
    if (!result) {
        console.error(url + " not found the file");
    }
    if (codeFlag) {
        new Canjs(result).run();
    }
    if (cb) cb(result);
}

